	add("faunch", "{\"term\":\"faunch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin uncertain. Used in wikipedia:Midland American English|Midland American English and wikipedia:Western American English|Western American English. Entered the fanspeak body of slang after writer wikipedia:Noel Loomis|Noel Loomis used it in a review in \u0027Pro-Phile\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A desire; a yearning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Byrne was the best thing about *Man in the Iron Mask*, as far as plot and acting. I do confess a \u0027\u0027faunch\u0027\u0027 for John Malkovitch, and DiCaprio should be allowed to develop his considerable latent acting abilities\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Me, I\u0027d caution against a Worldcon as one\u0027s first convention for somebody who has such a \u0027\u0027faunch\u0027\u0027 -- not to the point of avoiding it, if one were handy -- as while there\u0027s a lot that\u0027s fun at a Worldcon, it tends to be on the largish side, it\u0027s fairly easy to get lostish, and in most times and places (at least in the US) there\u0027s likely to be a good convention closer in time and space than the next Worldcon\", \"priority\":3}]}, \"synonyms\":{}}");

	add("faunivore", "{\"term\":\"faunivore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|fauna|vore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any animal that eats other animals\", \"priority\":1}]}, \"synonyms\":{}}");

